import React from 'react';
import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
} from './NavbarElements';
  
const Navbar = () => {
  return (
    <>
      <div className="navBar">
      <Nav>
        <Bars />
        <NavMenu>
          
            <NavLink to='/index' activeStyle>
            Home
            </NavLink>
            <NavLink to='/products' activeStyle>
            Products
            </NavLink>
            <NavLink to='/about' activeStyle>
            About Us
            </NavLink>
          {/* Second Nav */}
          {/* <NavBtnLink to='/sign-in'>Sign In</NavBtnLink> */}
        </NavMenu>
      </Nav>
      </div>
    </>
  );
};
  
export default Navbar;
